void printEntry(const char *src, const int *spaces) {
    for(;;) {
        int ncharacters = *spaces++;
        if (ncharacters == -2) break;

        int nspaces = *spaces++;
        
        for(int i=0; i < ncharacters; i++) {
            if(*src == 0) return;
            putchar(*src++);
        }

        if (nspaces == -1) {
            putchar(0x0a);
            continue;
        }

        for(int i=0; i < nspaces; i++) {
            putchar(0x20);
        }
    }
}

char *escape(const char *buf) {
    char *dest = (char *) malloc(1 * 1024 * 1024);
    char *dptr = dest;
    char *ptr = buf;
    while (*ptr != 0) {
        if (*ptr == 0x0a) {
            *dptr++ = 0x5c;
            *dptr++ = 0x6e;
            ptr++;
        } else if (*ptr == 0x20) {
            *dptr++ = 0x23;
            ptr++;
        } else if (*ptr == 0x5c || *ptr == 0x22) {
            *dptr++ = 0x5c;
            *dptr++ = *ptr++;
        } else {
            *dptr++ = *ptr++;
        }
    }

    return dest;
}

void printEscaped(char c, int wrapped) {
    if (wrapped & (c == 0x22 || c == 0x5c))
        putchar(0x5c);
    putchar(c);
}

void printLine(const char *line, int wrapped) {
    const char *ptr = line;

    while(*ptr != 0) {
        printEscaped(*ptr, wrapped);
        ptr++;
    }
}

void printAll(int wrapped) {
    const char **ptr = l;
    do {
        if (wrapped) putchar(0x22);

        printLine(*ptr++, wrapped);

        if (wrapped) {
            putchar(0x22);
            putchar(0x2c);
        }
        putchar(0x0a);
    }
    while(*ptr != 0);
}


